अपराध या दंडाभियोग (crime) की परिभाषा भिन्न-भिन्न रूपों में की गई है; यथा,

दंडाभियोग समाजविरोधी क्रिया है;
समाज द्वारा निर्धारित आचरण का उल्लंघन या उसकी अवहेलना दंडाभियोग है;
यह ऐसी क्रिया या क्रिया में त्रुटि है, जिसके लिये दोषी व्यक्ति को कानून द्वारा निर्धारित दंड दिया जाता है।अर्थात अपराध कानूनी नियमो कानूनों के उल्लंघन करने की नकारात्मक प्रक्रिया है जिससे समाज के तत्वों का विनाश होता है ।
इन परिभाषाओं के अनुसार किसी नगरपालिका के बनाए नियमों का उल्लंघन कर यदि कोई रात में बिना बत्ती जलाए साइकिल पर नगर की सड़क पर चले अथवा बिना पर्याप्त कारण के ट्रेन की जंजीर खींचकर गाड़ी खड़ी कर दे, तो वह भी उसी प्रकार दोषी माना जाएगा, जिस तरह कोई किसी की हत्या करने पर। किंतु साधारण अर्थ में लोग दंडाभियोग को हत्या, डकैती आदि जघन्य अपराधों के पर्याय के रूप में ही लेते हैं। लौकिक मत के अनुसार कोई चालक यदि तेजी एवं असावधानी से मोटर चलाते हुए किसी को अपनी गाड़ी से कुचल दे तो वह अपराधी नहीं कहा जा सकता, यदि उसके मन में अपराध करने की भावना न रही हो। जब हम गलती करते हैं तब वह अपराध कहलाता है

{\displaystyle }


निजीकरण व्यवसाय, उद्यम, एजेंसी या सार्वजनिक सेवा के स्वामित्व के सार्वजनिक क्षेत्र (राज्य या सरकार) से निजी क्षेत्र (निजी लाभ के लिए संचालित व्यवसाय) या निजी गैर-लाभ संगठनों के पास स्थानांतरित होने की घटना या प्रक्रिया है। एक व्यापक अर्थ में, निजीकरण राजस्व संग्रहण तथा कानून प्रवर्तन जैसे सरकारी प्रकार्यों सहित, सरकारी प्रकार्यों के निजी क्षेत्र में स्थानांतरण को संदर्भित करता है।
शब्द "निजीकरण" का दो असंबंधित लेनदेनों के वर्णन के लिए भी उपयोग किया गया है। पहला खरीद है, जैसे किसी सार्वजनिक निगम या स्वामित्व वाली कंपनी के स्टॉक के सभी शेयर बहुमत वाली कंपनी द्वारा खरीदा जाना, सार्वजनिक रूप से कारोबार वाले स्टॉक का निजीकरण है, जिसे प्रायः निजी इक्विटी भी कहते हैं। दूसरा है एक पारस्परिक संगठन या सहकारी संघ का पारस्परिक समझौता रद्द कर के एक संयुक्त स्टॉक कंपनी बनाना.

}}
मिरा (Mira) भारत के पश्चिम बंगाल राज्य के नदिया ज़िले में स्थित एक नगर है।
नादिया जिला अधिकतर जलोढ़ मैदान है जो हुगली नदी, जिसे स्थानीय भाषा में भागीरथी के नाम से जाना जाता है, के पूर्व में स्थित है। जलोढ़ मैदानों को जलांगी, चूर्णी और इचामती जैसी सहायक नदियों द्वारा काटा जाता है।  इन नदियों में गाद भर जाने से बाढ़ एक आवर्ती समस्या है।

